handlebars.registerHelper('quoteArray', function (array) {
  return array.map((item) => `'${item}'`).join(', ')
})

handlebars.registerHelper('incomeChartArray', function (array) {
  return JSON.stringify(
    array.map((item) => (Array.isArray(item) ? item : item)),
  )
})

handlebars.registerHelper('formatStaticLabels', function (data) {
  return JSON.stringify(data)
})

// Function to render a Handlebars template with dynamic data
const renderTemplate = (templateName, data) => {
  const filePath = path.join(__dirname, `${templateName}.hbs`)
  const source = fs.readFileSync(filePath, 'utf-8')
  const template = handlebars.compile(source)
  return template(data)
}

async function convertImageToBase64(url) {
  const response = await axios.get(url, { responseType: 'arraybuffer' })
  const base64Image = Buffer.from(response.data, 'binary').toString('base64')
  return `data:image/png;base64,${base64Image}`
}

async function getTotalPagesInPdf(htmlContent, browser) {
  const page = await browser.newPage()
  await page.setContent(htmlContent, { waitUntil: 'load' })

  // Render the page, ensuring all content is loaded
  await page.evaluate(() => window.scrollTo(0, document.body.scrollHeight)) // Make sure all content is rendered

  // Generate the PDF
  const pdfBuffer = await page.pdf({
    format: 'A4',
    printBackground: true,
    displayHeaderFooter: false, // Disable header/footer for total page calculation
  })

  // Load the PDF with pdf-lib
  const pdfDoc = await PDFDocument.load(pdfBuffer)

  // Get total number of pages
  const totalPages = pdfDoc.getPageCount()

  await page.close()
  return totalPages
}
